import logo from './logo.svg';
import './App.css';
import ExperientaList from './components/ExperientaList';
import ExperientaEdit from './components/ExperientaEdit';
import {BrowserRouter, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<ExperientaList/>}/>
          <Route path="/ExperientaEdit" element={<ExperientaEdit/>}/>
          <Route path="/updateExperienta/:id" element={<ExperientaEdit/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;

//npm install @material-ui/core
